import React from 'react';
import CursoBasico from '../components/eneagrama/curso/CursoBasico';
import Seccion1 from '../components/eneagrama/curso/Seccion1';

const Cursos = () => {
    return (
        <div className="cursos-page">
            <h1>Cursos de Eneagrama</h1>
            <div id="curso-basico">
                <CursoBasico />
            </div>
            <div id="seccion1">
                <Seccion1 />
            </div>
        </div>
    );
};

export default Cursos;
